import React from "react";
import { FaBars } from "react-icons/fa";
import { NavLink } from "react-router-dom";

function ProductConfirm() {
  return (
    <div className="grid place-items-center my-5">
      <div className="max-w-[30rem] w-full p-4">
        <div className="flex justify-end">
          <FaBars className="text-xl" />
        </div>
        <div className="flex flex-col justify-center items-center mt-28">
          {/* 
      ///////////Image & Title////////
      ////////////////////////// */}
          <div className="">
            <img
              src="/images/productImage.svg"
              className="rounded-full max-w-full h-auto"
            />
          </div>
          <div className="flex flex-col justify-center items-center ">
            <p className="text-[#3B2B2F] text-center text-6xl">DOJA - C99</p>
          </div>

          {/* 
      ///////////Form////////
      ////////////////////////// */}

          <input
            type="text"
            className="px-4 w-full h-12 rounded-2xl dm-sans-font mt-10 custom-shadow"
            placeholder="ENTER LOT NUMBER:"
          />

          {/* 
      ///////////Form////////
      ////////////////////////// */}

          <NavLink
            to={"../start-review"}
            className="mt-4 w-full py-3 bg-[#A7AE45] text-[#fff] rounded-xl text-2xl font-bold font-family text-center cursor-pointer]"
          >
            Confirm
          </NavLink>
        </div>
      </div>
    </div>
  );
}

export default ProductConfirm;
